						<FormControlLabel value="no_anterior"  onFocus={(event) => event.stopPropagation()}  control={<AzulRadio />} label="No anterior" />
					</RadioGroup>

					<FormLabel component="legend">Killip-Kimball clase</FormLabel>
					 <RadioGroup row={true} aria-label="gender" name="cuadroClinico[shockCardio]" onFocus={(event) => event.stopPropagation()} value={sexo} onChange={handleChangeSexo}>
						<FormControlLabel value="a"  onFocus={(event) => event.stopPropagation()}  control={<AzulRadio  />} label="A" />
						<FormControlLabel value="b" onFocus={(event) => event.stopPropagation()} control={<AzulRadio />} label="B" />
						<FormControlLabel value="c" onFocus={(event) => event.stopPropagation()} control={<AzulRadio />} label="C" />
						<FormControlLabel value="d" onFocus={(event) => event.stopPropagation()} control={<AzulRadio />} label="D" />


					</RadioGroup> 
					<FormLabel component="legend">Tipo ATC</FormLabel>
					 <RadioGroup row={true} aria-label="gender" name="cuadroClinico[icg]" onFocus={(event) => event.stopPropagation()} value={sexo} onChange={handleChangeSexo}>

						<FormControlLabel value="Primaria"  onFocus={(event) => event.stopPropagation()}  control={<AzulRadio />} label="Primaria" />
						<FormControlLabel value="rescate" onFocus={(event) => event.stopPropagation()} control={<AzulRadio  />} label="Rescate" />
						<FormControlLabel value="facilitada" onFocus={(event) => event.stopPropagation()} control={<AzulRadio  />} label="Facilitada" />


					</RadioGroup> 
					<FormLabel component="legend">Diurna</FormLabel>
					 <RadioGroup row={true} aria-label="gender" name="cuadroClinico[arritmiaBloqueoAv]" onFocus={(event) => event.stopPropagation()} value={sexo} onChange={handleChangeSexo}>

						<FormControlLabel value="si"  onFocus={(event) => event.stopPropagation()}  control={<AzulRadio />} label="Si" />
						<FormControlLabel value="no" onFocus={(event) => event.stopPropagation()} control={<AzulRadio  />} label="No" />

					</RadioGroup>
					<TextField
					 id="datetime-local"
					 label="Inicio del dolor"
					 type="datetime-local"
					 defaultValue=""
					 sx={{ width: 250 }}
					 InputLabelProps={{
					   shrink: true,
					 }}
				   />
				   <TextField
					 id="datetime-local"
					 label="Llegada al Sanatorio"
					 type="datetime-local"
					 defaultValue=""
					 sx={{ width: 250 }}
					 InputLabelProps={{
					   shrink: true,
					 }}
				   />
				   <TextField
					 id="datetime-local"
					 label="Pase de cuerda"
					 type="datetime-local"
					 defaultValue=""
					 sx={{ width: 250 }}
					 InputLabelProps={{
					   shrink: true,
					 }}
				   />
				</FormControl>

				}
			</Grid> 
		</Grid> 
	  </Accordion >
	 )
 }
